(936,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 01:03:34',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (15, \'content_left\', \'<p>Vinoř, Praha<br /> Architekt: <strong>A6 atelier</strong> - <a rel=\\\\\\\"external\\\\\\\">www.a6.cz</a><br /> Klient: <strong>Vedom</strong> stavební studio - <a rel=\\\\\\\"external\\\\\\\">www.vedom.cz</a></p>\')'),
(937,	1,	1,	1,	'content',	'index',	'DELETE',	'2025-01-20 01:03:34',	'DELETE FROM cms_section_text_value\r\n								  WHERE section_text_id = 15 AND\r\n								  		code = \'content_right\''),
(938,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 01:03:34',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (15, \'content_right\', \'<p>Nově postavený rodinný dům se nachází uprostřed zástavby rodinných domů v pražské Vinoři. Původně na parcele stál rovněž rodinný dům. Ten už ale neodpovídal potřebám soudobého bydlení ani technickým parametrům výstavby. Nevyhovující bylo i umístění samostatné garáže hluboko uvnitř pozemku. Z těchto důvodů se investor rozhodl stávající objekty odstranit a postavit nový rodinný dům.</p>\\r\\n<p> </p>\\r\\n<p>“Pan fotograf Jiří Šebek odvedl profesionální práci při focení architektury v dohodnutých termínech. Skvělá práce se světlem a atmosféra fotografií.”</p>\\r\\n<p><strong>Ing. arch. Pavel Středa</strong></p>\')'),
