(1708,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 17:25:09',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (3, \'anotation\', \'Fotografické studio se zaměřením na reklamní fotografii architektury, interiérů a designu. Představíme váš interiér s pomocí video prezentace.\')'),
