(1712,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 17:25:09',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (3, \'promo_content\', \'<p>Potřebujete prodat nezařízený byt či dům? Nevadí, zajistím vám home staging.</p>\\r\\n<p>Jedná se o profesionální přípravu nemovitostí na fotografování či prohlídky. S pomocí homestagingu se podaří navodit tu správnou atmosféru.</p>\')'),
