(1842,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 17:53:43',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (6, \'content\', \'<p>Jiří Šebek je profesionální fotograf, který zachycuje architekturu a interiéry více než 15 let. Za tu dobu spolupracoval s více než 100+ klienty, mezi kterými najdeme řadu architektonických studií, designérů či návrhářů.</p>\\r\\n<p>Za své fotografie získal 4 významná oborová ocenění. Mezi nimi například Czech Press Photo, za soubor „Chrámy nové doby“. Tato série zachycuje nově se rodící pražskou architekturu.</p>\\r\\n<p>Postupně založil fotostudio, které se zaměřuje na tvorbu reklamní fotografie a videa v oblasti architektury.</p>\')'),
