(2100,	1,	1,	1,	'content',	'index',	'DELETE',	'2025-01-20 19:08:17',	'DELETE FROM cms_section_text_value\r\n								  WHERE section_text_id = 39 AND\r\n								  		code = \'anotation\''),
(2101,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 19:08:17',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (39, \'anotation\', \'Popis fotky, který tady většinou nebude. Občas fotograf potřebuje mít štěstí, tak aby byl na správném místě v pravou chvíli. Dle předpovědi měla být toto ráno mlha. Vstávám tedy přes šestou hodinou a vyrážím\')'),
(2102,	1,	1,	1,	'content',	'index',	'DELETE',	'2025-01-20 19:08:17',	'DELETE FROM cms_section_text_value\r\n								  WHERE section_text_id = 39 AND\r\n								  		code = \'more_info\''),
(2103,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 19:08:17',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (39, \'more_info\', \'<h3>Limitovaná edice 10 ks</h3>\\r\\n<ul>\\r\\n<li>Fotografii je možné zakoupit ve striktně limitované edici 10 ks.</li>\\r\\n<li>Každá fotografie je ručně signována a očíslována.</li>\\r\\n<li>Spolu s fotografií obdržíte certifikát, potvrzující originální autorské dílo.</li>\\r\\n</ul>\\r\\n<h3>Fineart print</h3>\\r\\n<p>Fotografie jsou zhotoveny archivním pigmentovým tiskem na papír muzejní kvality vysokou gramáží.</p>\\r\\n<table>\\r\\n<tbody>\\r\\n<tr>\\r\\n<td>Malá 50×50 cm</td>\\r\\n<td>Edice 3 ks</td>\\r\\n<td>5 500 Kč</td>\\r\\n</tr>\\r\\n<tr>\\r\\n<td>Střední 70×70 cm</td>\\r\\n<td>Edice 3 ks</td>\\r\\n<td>7 000 Kč</td>\\r\\n</tr>\\r\\n<tr>\\r\\n<td>Velká 100×100 cm</td>\\r\\n<td>Edice 3 ks</td>\\r\\n<td>10 000 Kč</td>\\r\\n</tr>\\r\\n<tr>\\r\\n<td>One 120×120 cm</td>\\r\\n<td>Edice 1 ks</td>\\r\\n<td>17 000 Kč</td>\\r\\n</tr>\\r\\n</tbody>\\r\\n</table>\\r\\n<h3>Fineart obraz</h3>\\r\\n<p>Zarámovaná fotografie do precizně zpracovaných rámů ze dřeva či hliníku.<br /> Rámy jsou voleny přesně na míru a bude vám sestavena cenová kalkulace.</p>\')'),
