(2291,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 19:11:13',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (43, \'content\', \'<p>Chrámy nové doby jsou výtvarnou sérií zachycující pražskou moderní a postmoderní architekturu. Tato série začala vznikat v roce 2016 a stále není uzavřena.</p>\\r\\n<p>Aktuálně čítá cca 30 striktně minimalistických, kontrasty oplývajících snímků, které jsou zasazeny do čtvercového formátu a fotografovány na dlouhý čas, aby proti sobě postavily statičnost budov a dynamiku mraků. S touto sérií jsem v roce 2016 vyhrál soutěž Czech Press Photo.</p>\\r\\n<p>Více o této sérii naleznete na webu Chramynovedoby.cz.</p>\')'),
