(2519,	1,	1,	1,	'content',	'index',	'INSERT',	'2025-01-20 22:53:21',	'INSERT INTO cms_section_text_value\r\n									  (section_text_id, code, text_val)\r\n									  VALUES\r\n									  (31, \'content_right\', \'<p>Nově postavený rodinný dům se nachází uprostřed zástavby rodinných domů v pražské Vinoři. Původně na parcele stál rovněž rodinný dům. Ten už ale neodpovídal potřebám soudobého bydlení ani technickým parametrům výstavby. Nevyhovující bylo i umístění samostatné garáže hluboko uvnitř pozemku. Z těchto důvodů se investor rozhodl stávající objekty odstranit a postavit nový rodinný dům.</p>\\r\\n<p> </p>\\r\\n<p>“Pan fotograf Jiří Šebek odvedl profesionální práci při focení architektury v dohodnutých termínech. Skvělá práce se světlem a atmosféra fotografií.”</p>\\r\\n<p><strong>Ing. arch. Pavel Středa</strong></p>\')'),
