(1,	'header',	NULL,	'Fotografie architektury',	NULL,	NULL,	NULL),
(1,	'anotation',	NULL,	NULL,	'Fotografické studio se zaměřením na fotografii architektury a interiérů.\r\nZachytíme váš projekt z dronu či vám připravíme jeho video prezentaci.',	NULL,	NULL),
