(7,	'content_right',	NULL,	NULL,	'<h2>Spolupracovníci studia</h2>\r\n<p><strong>David Vančišin</strong> - fotograf, asistent, postprodukce</p>\r\n<p><strong>Vojta Herout</strong> - fotograf, asistent</p>\r\n<p><strong>Josef Hromada</strong> - dron</p>\r\n<p><strong>Marek Danišík</strong> - video a střih</p>',	NULL,	NULL),
