(13,	'header',	NULL,	'Nadpis H1 - Workshop fotografování zimní krajiny',	NULL,	NULL,	NULL),
(13,	'content',	NULL,	NULL,	'<p>Víkendový kurz <em>fotografování zimní</em> krajiny. <s>Fotokurz bude probíhat</s> v Krušných horách.<br />Fotit budeme převážně v okolí <strong>Božího daru</strong>, Klínovce a Fichtelbergu.</p>\r\n<p><img src=\\\"/app/web1/design/_smazat_/art-image.jpg\\\" alt=\\\"\\\" /></p>\r\n<p>Na spoustě míst ve vodě rostou zelené řasy, <span style=\\\"text-decoration: underline;\\\">což vytváří ideální</span> podmínky pro fotografování. Na jednom snímku tak můžete mít vodu, <a href=\\\"#\\\">odkaz odkaz</a> a v pozadí skály. Místy je možné najít ve vodě různé kameny, malé potůčky a kaskády. Tedy vše co je potřeba pro fotografování vody na dlouhý čas.</p>\r\n<h2>Nadpis H2 - Termín worskhopu</h2>\r\n<p>Pátek 17.1. (cca. od 18:00) - neděle 19.1. (10:00)</p>\r\n<ul>\r\n<li>Fotografii je možné zakoupit ve striktně limitované edici 10 ks.</li>\r\n<li>Každá fotografie je ručně signována a očíslována.</li>\r\n<li>Spolu s fotografií obdržíte certifikát, potvrzující originální autorské dílo.\r\n<ul>\r\n<li>Fotografii je možné zakoupit ve striktně limitované edici 10 ks.</li>\r\n<li>Každá fotografie je ručně signována a očíslována.</li>\r\n<li>Spolu s fotografií obdržíte certifikát, potvrzující originální autorské dílo.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ol>\r\n<li>Fotografii je možné zakoupit ve striktně limitované edici 10 ks.</li>\r\n<li>Každá fotografie je ručně signována a očíslována.</li>\r\n<li>Spolu s fotografií obdržíte certifikát, potvrzující originální autorské dílo.<ol>\r\n<li>Fotografii je možné zakoupit ve striktně limitované edici 10 ks.</li>\r\n<li>Každá fotografie je ručně signována a očíslována.</li>\r\n<li>Spolu s fotografií obdržíte certifikát, potvrzující originální autorské dílo.</li>\r\n</ol></li>\r\n</ol>\r\n<h3>Nadpis H3</h3>\r\n<p><small>Malý upřesnující text</small></p>\r\n<table>\r\n<tbody>\r\n<tr><th>Nazev</th><th>Kusy</th><th>Cena</th></tr>\r\n<tr><th>Střední 70×70 cm</th>\r\n<td>Edice 3 ks</td>\r\n<td>7 000 Kč</td>\r\n</tr>\r\n<tr><th>Velká 100×100 cm</th>\r\n<td>Edice 3 ks</td>\r\n<td>10 000 Kč</td>\r\n</tr>\r\n<tr><th>One 120×120 cm</th>\r\n<td>Edice 1 ks</td>\r\n<td>17 000 Kč</td>\r\n</tr>\r\n</tbody>\r\n</table>',	NULL,	NULL),
(14,	'header',	NULL,	'404 - stránka nenalezena',	NULL,	NULL,	NULL),
(14,	'content',	NULL,	NULL,	'',	NULL,	NULL),
(15,	'header',	NULL,	'Praha',	NULL,	NULL,	NULL),
(15,	'architect',	NULL,	'Ing. arch. Karel Pražák',	NULL,	NULL,	NULL),
(15,	'content_left',	NULL,	NULL,	'<p>Vinoř, Praha<br /> Architekt: <strong>A6 atelier</strong> - <a rel=\\\"external\\\">www.a6.cz</a><br /> Klient: <strong>Vedom</strong> stavební studio - <a rel=\\\"external\\\">www.vedom.cz</a></p>',	NULL,	NULL),
(15,	'content_right',	NULL,	NULL,	'<p>Nově postavený rodinný dům se nachází uprostřed zástavby rodinných domů v pražské Vinoři. Původně na parcele stál rovněž rodinný dům. Ten už ale neodpovídal potřebám soudobého bydlení ani technickým parametrům výstavby. Nevyhovující bylo i umístění samostatné garáže hluboko uvnitř pozemku. Z těchto důvodů se investor rozhodl stávající objekty odstranit a postavit nový rodinný dům.</p>\r\n<p>“Pan fotograf Jiří Šebek odvedl profesionální práci při focení architektury v dohodnutých termínech. Skvělá práce se světlem a atmosféra fotografií.”</p>\r\n<p><strong>Ing. arch. Pavel Středa</strong></p>',	NULL,	NULL),
