(34,	'content_left',	NULL,	NULL,	'<p>Vinoř, Praha<br /> Architekt: <strong>A6 atelier</strong> - <a rel=\\\"external\\\">www.a6.cz</a><br /> Klient: <strong>Vedom</strong> stavební studio - <a rel=\\\"external\\\">www.vedom.cz</a></p>',	NULL,	NULL),
(34,	'content_right',	NULL,	NULL,	'<p>Nově postavený rodinný dům se nachází uprostřed zástavby rodinných domů v pražské Vinoři. Původně na parcele stál rovněž rodinný dům. Ten už ale neodpovídal potřebám soudobého bydlení ani technickým parametrům výstavby. Nevyhovující bylo i umístění samostatné garáže hluboko uvnitř pozemku. Z těchto důvodů se investor rozhodl stávající objekty odstranit a postavit nový rodinný dům.</p>\r\n<p> </p>\r\n<p>“Pan fotograf Jiří Šebek odvedl profesionální práci při focení architektury v dohodnutých termínech. Skvělá práce se světlem a atmosféra fotografií.”</p>\r\n<p><strong>Ing. arch. Pavel Středa</strong></p>',	NULL,	NULL),
(35,	'header',	NULL,	'České Budějovice',	NULL,	NULL,	NULL),
(35,	'architect',	NULL,	'Ing. Josef Novák',	NULL,	NULL,	NULL),
(35,	'content_left',	NULL,	NULL,	'<p>Vinoř, Praha<br /> Architekt: <strong>A6 atelier</strong> - <a rel=\\\"external\\\">www.a6.cz</a><br /> Klient: <strong>Vedom</strong> stavební studio - <a rel=\\\"external\\\">www.vedom.cz</a></p>',	NULL,	NULL),
(35,	'content_right',	NULL,	NULL,	'<p>Nově postavený rodinný dům se nachází uprostřed zástavby rodinných domů v pražské Vinoři. Původně na parcele stál rovněž rodinný dům. Ten už ale neodpovídal potřebám soudobého bydlení ani technickým parametrům výstavby. Nevyhovující bylo i umístění samostatné garáže hluboko uvnitř pozemku. Z těchto důvodů se investor rozhodl stávající objekty odstranit a postavit nový rodinný dům.</p>\r\n<p> </p>\r\n<p>“Pan fotograf Jiří Šebek odvedl profesionální práci při focení architektury v dohodnutých termínech. Skvělá práce se světlem a atmosféra fotografií.”</p>\r\n<p><strong>Ing. arch. Pavel Středa</strong></p>',	NULL,	NULL),
(3,	'header',	NULL,	'15 let praxe s fotografováním interiérů a interiérového designu',	NULL,	NULL,	NULL),
(3,	'anotation',	NULL,	NULL,	'Fotografické studio se zaměřením na reklamní fotografii architektury, interiérů a designu. Představíme váš interiér s pomocí video prezentace.',	NULL,	NULL),
(3,	'promo_header',	NULL,	'Homestaging pro pocit domova',	NULL,	NULL,	NULL),
(3,	'promo_content',	NULL,	NULL,	'<p>Potřebujete prodat nezařízený byt či dům? Nevadí, zajistím vám home staging.</p>\r\n<p>Jedná se o profesionální přípravu nemovitostí na fotografování či prohlídky. S pomocí homestagingu se podaří navodit tu správnou atmosféru.</p>',	NULL,	NULL),
(6,	'header',	NULL,	'Bio',	NULL,	NULL,	NULL),
(6,	'content',	NULL,	NULL,	'<p>Jiří Šebek je profesionální fotograf, který zachycuje architekturu a interiéry více než 15 let. Za tu dobu spolupracoval s více než 100+ klienty, mezi kterými najdeme řadu architektonických studií, designérů či návrhářů.</p>\r\n<p>Za své fotografie získal 4 významná oborová ocenění. Mezi nimi například Czech Press Photo, za soubor „Chrámy nové doby“. Tato série zachycuje nově se rodící pražskou architekturu.</p>\r\n<p>Postupně založil fotostudio, které se zaměřuje na tvorbu reklamní fotografie a videa v oblasti architektury.</p>',	NULL,	NULL),
(6,	'content_left',	NULL,	NULL,	'<h2>Spolupracovníci studia</h2>\r\n<p><strong>David Vančišin</strong> - fotograf, asistent, postprodukce</p>\r\n<p><strong>Vojta Herout</strong> - fotograf, asistent</p>\r\n<p><strong>Josef Hromada</strong> - dron</p>\r\n<p><strong>Marek Danišík</strong> - video a střih</p>',	NULL,	NULL),
(6,	'content_right',	NULL,	NULL,	'<h2>Milníky &amp; ocenění</h2>\r\n<p><strong>Czech Press Photo</strong> - 1. místo Grant Prahy</p>\r\n<p><strong>Praha fotografická</strong> - Cena svazu Českých fotografů</p>\r\n<p><strong>Praha fotografická</strong> - 1. místo</p>\r\n<p><strong>Et Cetera</strong> - Top 18 young EU photographers</p>',	NULL,	NULL),
(6,	'projects_description',	NULL,	NULL,	'Ve své volné tvorbě se Jiří snaží spojit svět architektury a FineArt fotografie do jednoho celku. Jedná se o fotografie, kde se mísi minimalismus a estatika, které upozaďují chaotičnost městské zástavby.',	NULL,	NULL),
(36,	'header',	NULL,	'Mosty',	NULL,	NULL,	NULL),
(36,	'content',	NULL,	NULL,	'<p>Chrámy nové doby jsou výtvarnou sérií zachycující pražskou moderní a postmoderní architekturu. Tato série začala vznikat v roce 2016 a stále není uzavřena.</p>\r\n<p>Aktuálně čítá cca 30 striktně minimalistických, kontrasty oplývajících snímků, které jsou zasazeny do čtvercového formátu a fotografovány na dlouhý čas, aby proti sobě postavily statičnost budov a dynamiku mraků. S touto sérií jsem v roce 2016 vyhrál soutěž Czech Press Photo.</p>\r\n<p>Více o této sérii naleznete na webu Chramynovedoby.cz.</p>',	NULL,	NULL),
(37,	'anotation',	NULL,	NULL,	'Popis fotky, který tady většinou nebude. Občas fotograf potřebuje mít štěstí, tak aby byl na správném místě v pravou chvíli. Dle předpovědi měla být toto ráno mlha. Vstávám tedy přes šestou hodinou a vyrážím',	NULL,	NULL),
(37,	'more_info',	NULL,	NULL,	'<h3>Limitovaná edice 10 ks</h3>\r\n<ul>\r\n<li>Fotografii je možné zakoupit ve striktně limitované edici 10 ks.</li>\r\n<li>Každá fotografie je ručně signována a očíslována.</li>\r\n<li>Spolu s fotografií obdržíte certifikát, potvrzující originální autorské dílo.</li>\r\n</ul>\r\n<h3>Fineart print</h3>\r\n<p>Fotografie jsou zhotoveny archivním pigmentovým tiskem na papír muzejní kvality vysokou gramáží.</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Malá 50×50 cm</td>\r\n<td>Edice 3 ks</td>\r\n<td>5 500 Kč</td>\r\n</tr>\r\n<tr>\r\n<td>Střední 70×70 cm</td>\r\n<td>Edice 3 ks</td>\r\n<td>7 000 Kč</td>\r\n</tr>\r\n<tr>\r\n<td>Velká 100×100 cm</td>\r\n<td>Edice 3 ks</td>\r\n<td>10 000 Kč</td>\r\n</tr>\r\n<tr>\r\n<td>One 120×120 cm</td>\r\n<td>Edice 1 ks</td>\r\n<td>17 000 Kč</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Fineart obraz</h3>\r\n<p>Zarámovaná fotografie do precizně zpracovaných rámů ze dřeva či hliníku.<br /> Rámy jsou voleny přesně na míru a bude vám sestavena cenová kalkulace.</p>',	NULL,	NULL),
